-- ----------------------------
-- View structure for view_convocatorias
-- ----------------------------
DROP VIEW IF EXISTS `view_convocatorias`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_convocatorias` AS select `c`.`IDconvocatoria` AS `IDconvocatoria`,`t`.`IDtipo` AS `IDtipo`,`t`.`descripcionCorta` AS `descripcionCorta`,`c`.`numero` AS `numero`,`c`.`fecha` AS `fecha`,`c`.`cantidad` AS `cantidad`,`c`.`fechaRegistro` AS `fechaRegistro`,`c`.`asuntoContrato` AS `asuntoContrato`,`c`.`estado` AS `estado`,`c`.`registradoPor` AS `usuarioRegistro`,`c`.`fechaModificacion` AS `fechaModificacion` from (`convocatoria` `c` join `tipo` `t` on(`c`.`IDtipo` = `t`.`IDtipo`)) order by `c`.`fecha` desc,`c`.`numero` desc;

-- ----------------------------
-- View structure for view_usuarios
